import React, { Component } from 'react';


export default class GoalMessage extends Component {

    constructor(props) {
        super(props);
        this.state = {
            difficulty: '',
            score: null,
        }
    }

    foo() {
        let score = this.state.difficulty === "IMPOSSIBLE" ? this.state.score : Math.floor(this.state.score);
        this.bar(score);
    }

    bar = score => {
        console.log('SCORE =', score);
        // if (score === 10) {
